settings.cellStyleFunction:
// Colors based on Standards & Best Practices
//
// Below -115 very weak
if (value < -115) return {
    color: "white", "font-weight": "bold",  backgroundColor: "red", paddingLeft: '10px', fontSize: '14px',
};
// Between -115 & -110 weak
else if (value >= -115 && value < -110) return { 
color: "red", "font-weight": "bold", paddingLeft: '8px', fontSize: '14px'
};
// bewtween -110 & -100 Low
else if (value >= -110 && value <= -100) return { 
color: "orange", "font-weight": "bold", paddingLeft: '0px', fontSize: '14px'
};
// Between -99 & -70 Strong
else if (value >= -99 && value <= -70) return { 
color: "green", "font-weight": "normal", paddingLeft: '0px', fontSize: '14px'
};
// Between & 70 Very Strong
else if (value > -70) return { 
color: "green", "font-weight": "bold", paddingLeft: '0px', fontSize: '14px'
};

// Based on Standards & Best Practices
//
// Greater then -7.5 Bad
if (value <= -7.5) return {
    color: "red", "font-weight": "bold", paddingLeft: '0px', fontSize: '16px',
    };
// Between -7.6 & 0 is low
else if (value > -7.5  && value <= 0) return { 
color: "orange", "font-weight": "bold", paddingLeft: '0px', fontSize: '14px'
};
// Above 0 is Good
else return { 
color: "green", "font-weight": "bold", paddingLeft: '0px', fontSize: '14px'
};

// Colors based subband 2 & Uplink / Downlink
//
// Uplink 903.9 - 905.3
if (value >= 903.9 && value <= 905.3) return {
    color: "Green", "font-weight": "bold", paddingLeft: '0px', fontSize: '16px',
};
// Downlink 923.3 & 927.5
else if (value >= 923.3 && value <= 927.5) return { 
color: "White", "font-weight": "bold",backgroundColor: "Green", paddingLeft: '8px', fontSize: '14px'
};
// All traffic in other sub-band
else return { 
color: "White", "font-weight": "bold",backgroundColor: "red", paddingLeft: '8px', fontSize: '14px'
};

var color;
if (value === "true") {
    color = 'rgb(39, 134, 34)';
} else {
    color = 'rgb(255, 0, 0)';
}
return {
    color: color,
    fontSize: '18px'
};

