function EditAssetDialogController($scope,$mdDialog) {
    let vm = this;
    vm.types = types;
    vm.loading = false;
    vm.attributes = {};

    getEntityInfo();

    function getEntityInfo() {
        vm.loading = true;
        assetService.getAsset(entityId.id).then(
            (asset) => {
                attributeService.getEntityAttributesValues(entityId.entityType, entityId.id, 'SERVER_SCOPE').then(
                   (data) => {
                        entityGroupService.getEntityGroupIdsForEntityId(entityId.entityType, entityId.id).then(
                            (assetGroupIds) => {
                                let ids = [];
                                assetGroupIds.forEach((groupId) => {
                                    ids.push(groupId.id);
                                });
                                entityGroupService.getEntityGroupsByIds(ids).then(
                                    (assetGroups) => {
                                        vm.assetGroups = assetGroups;
                                        let nonAllResult = assetGroups.filter(group => group.groupAll === false);
                                        vm.targetGroup = angular.copy((nonAllResult.length) ? nonAllResult[0] : assetGroups[0]);
                                        vm.prevTargetGroup = angular.copy(vm.targetGroup);
                                        vm.asset = asset;
                                        if (data.length) {
                                            getEntityAttributes(data);
                                        }
                                        vm.loading = false;
                                    }
                                );
                            }
                        )
                   } 
                );
            }
        )
    }

    vm.cancel = function() {
        $mdDialog.hide();
    };

    vm.save = () => {
        vm.loading = true;
        $scope.editAssetForm.$setPristine();
        assetService.saveAsset(vm.asset).then(
            () => {
                saveAttributes().then(
                    () => {
                        if (vm.prevTargetGroup.id.id == vm.targetGroup.id.id) {
                            updateAliasData();
                            vm.loading = false;
                            $mdDialog.hide();
                        } else {
                            let groupAll = vm.assetGroups.filter(group => group.groupAll === true)[0];
                            if (vm.prevTargetGroup.id.id == groupAll.id.id) {
                                entityGroupService.addEntityToEntityGroup(vm.targetGroup.id.id, vm.asset.id.id).then(
                                    () => {
                                        updateAliasData();
                                        vm.loading = false;
                                        $mdDialog.hide();
                                    }
                                )
                            } else {
                                entityGroupService.removeEntityFromEntityGroup(vm.prevTargetGroup.id.id, vm.asset.id.id).then(
                                    () => {
                                        let addGroupPromise = (vm.targetGroup.id.id != groupAll.id.id) ? entityGroupService.addEntityToEntityGroup(vm.targetGroup.id.id, vm.asset.id.id) : $q.when([]);
                                        addGroupPromise.then(
                                            () => {
                                                updateAliasData();
                                                vm.loading = false;
                                                $mdDialog.hide();
                                            }
                                        );
                                    }
                                )
                            }
                        }
                    }
                );
            },
            () => {
                vm.loading = false;
            }
        );
    }

    function getEntityAttributes(attributes) {
        for (let i = 0; i < attributes.length; i++) {
            vm.attributes[attributes[i].key] = attributes[i].value; 
        }
    }

    function saveAttributes() {
        let attributesArray = [];
        for (let key in vm.attributes) {
            attributesArray.push({key: key, value: vm.attributes[key]});
        }
        if (attributesArray.length > 0) {
            return attributeService.saveEntityAttributes(entityId.entityType, entityId.id, "SERVER_SCOPE", attributesArray);
        }  else {
            return $q.when([]);
        }
    }

    function updateAliasData() {
        let aliasIds = [];
        for (let id in widgetContext.aliasController.resolvedAliases) {
            aliasIds.push(id);
        }
        let tasks = [];
        aliasIds.forEach((aliasId) => {
            widgetContext.aliasController.setAliasUnresolved(aliasId);
            tasks.push(widgetContext.aliasController.getAliasInfo(aliasId));
        });
        console.log(widgetContext);
        $q.all(tasks).then(() => {
            $rootScope.$broadcast('widgetForceReInit');
        });
    }
}

